import './App.css';
import React, {useEffect, useState} from 'react'

const App = () => {
    useEffect(() => {
        fetch("https://localhost:5001", {
            mode: 'cors'
        })
            .then(response => {
                console.log(response)
            })
    }, [])

    return (
        <div>
            This is testing the server communication:
        </div>
    )

}

export default App;
